import React from 'react';
import Loader from './Loader.js';
import TextColorizer from './TextColorizer.js';

class Header extends React.Component {

    constructor(props) {
        super(props);
        this.company = this.props.company;
    }

    render() {
        const navClasses = "width-100-percent header faded bg-dark";
        const isNavButton = (event) => (event.target.nodeName === "BUTTON") ? true : false;
        const showContent = (event) => (window.location.pathname = event.target.innerHTML);
        const siteNavClick = (event) => (isNavButton(event)) ? (showContent(event)) : false; 
        return (
            <div className="App-header">
                <div className="flexContainer header">
                    <div className="flex3Column bg-green" />
                    <div className="flex3Column bg-yellow" />
                    <div className="flex3Column bg-red" />
                </div>
                <div className={navClasses} onClick={siteNavClick}>
                    <button>Home</button>
                    <button>BowlBuilder</button>
                    <button>TempConverter</button>
                    <button>Essay</button>
                    <button>Reservation</button>
                    <button>GuestList</button>
                    <button>SurfLog</button>
                </div>
                <Loader />
                <TextColorizer text={this.company}/>
            </div>
        );
    };
}

export default Header;
